import React from 'react';


function Food(props){

    return(
        <div>
            <form>
            <input value={props.foodDish} name='foodDish' onChange={props.handleClick}/>
            <p> Dish: {props.foodDish} </p>
            </form>
        </div>
    )
}

export default Food;
